    lv_img_set_src(img3, &bg_cat_img);
    lv_obj_align(img3, LV_ALIGN_CENTER, 0, 0);
    // lv_obj_set_size(img3, 150, 69);

    lv_obj_t * img4 = lv_img_create(lv_screen_active());
    lv_img_set_src(img4, LV_SYMBOL_HOME "SoloSangeet");
